import React, { useState } from 'react';
import './Booking.css';

const Booking = () => {
  const [selectedEvent, setSelectedEvent] = useState('');
  const [ticketQuantity, setTicketQuantity] = useState(1);
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [price, setPrice] = useState(0);

  const eventPrices = {
    "Emerging CEO's": 100,
    "BTS-Kpop": 150,
    "Food festival": 50,
    "India VS England": 120,
    "Tech Innovators Summit 2024": 200,
    "Art & Culture Festival": 80,
    "Indie Music Event": 90,
    "Hornbill Music Festival": 110,
  };

  const handleEventChange = (e) => {
    const selectedEvent = e.target.value;
    setSelectedEvent(selectedEvent);
    setPrice(eventPrices[selectedEvent]);
  };

  const handleBookingSubmit = (e) => {
    e.preventDefault();
    const totalPrice = ticketQuantity * price;
    alert(`Booking confirmed for ${name} (${email}) - ${ticketQuantity} tickets for ${selectedEvent}. Total Price: $${totalPrice}`);
  };

  return (
    <div className="booking-container">
      <h1>Book Your Event</h1>
      <form onSubmit={handleBookingSubmit} className="booking-form">
        <div className="form-group">
          <label htmlFor="event">Choose Event:</label>
          <select
            id="event"
            value={selectedEvent}
            onChange={handleEventChange}
            required
          >
            <option value="">Select an Event</option>
            {Object.keys(eventPrices).map((event) => (
              <option key={event} value={event}>{event}</option>
            ))}
          </select>
        </div>

        <div className="form-group">
          <label htmlFor="quantity">Number of Tickets:</label>
          <input
            type="number"
            id="quantity"
            value={ticketQuantity}
            onChange={(e) => setTicketQuantity(e.target.value)}
            min="1"
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="price">Price per Ticket:</label>
          <input
            type="text"
            id="price"
            value={`₹${price}`}
            readOnly
          />
        </div>

        <div className="form-group">
          <label htmlFor="total">Total Price:</label>
          <input
            type="text"
            id="total"
            value={`₹${ticketQuantity * price}`}
            readOnly
          />
        </div>

        <div className="form-group">
          <label htmlFor="name">Full Name:</label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="email">Email Address:</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>

        <div className="form-group">
          <label htmlFor="phone">Phone Number:</label>
          <input
            type="tel"
            id="phone"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            required
          />
        </div>

        <button type="submit" className="booking-btn">Confirm Booking</button>
      </form>
    </div>
  );
};

export default Booking;
